import Header from '../../components/main_page/header/Header';
import './admin_page.css';
import UserHomeLayout from '../../layout/UserHomeLayout';
import axios from 'axios';
import { LoadAllAdminData } from './LoadAllDataAdmin';
import React, { useState } from 'react';
import { useDispatch } from 'react-redux';
import { setUser } from '../../action/user/userAction';

function AdminPage() {
    store.dispatch()
    const user = new Promise((resolve, reject) => {
        axios.get("http://localhost:8080/admin/find/" + sessionStorage.getItem("user")).then(response => {
            resolve(response.data)
        }).catch(reject("ERROR"))
    })

    
    useDispatch(setUser(user))

    return (
        <div className="">
            <LoadAllAdminData />
            <Header
                type="ADMIN" />
            {/* <UserHomeLayout 
                    type="ADMIN" /> */}
        </div>
    );

}

export default AdminPage;
